import { Component } from "react";
const styles = {
    Layout: {
        backgroundColor: '#e84328', 
        color: '#fff',
        padding: '10px 15px',
        border: 'none',
        borderRadius: '5px',
        cursor:'pointer',
    }
}

class Layout extends Component {
    render() { 
        return (
            <div>
                <div>
                    {this.props.children}
                </div>
            </div>
        )
    }
}
export default Layout
